import "../styles/teachers.css";
const disciplines = [
    "Math",
    "Physics",
    "Music",
];

const teachers = [
    {
        name: "Abner Cruz",
        image: "",
        disciplines: ["Math", "Physics"],
    },
    {
        name: "Renata Nóbrega",
        disciplines: ["Music"],
    },
];

function Teachers() {
    return (
        <div className="HomePageGlobalDiv">
            <div className="NousNovaTeachers">
                <h2>Teachers</h2>
                <ul>
                    {teachers.map((teacher, index) => (
                        <li key={index} cla>
                            <strong>{teacher.name}</strong>
                            <ul>
                                {teacher.disciplines.map((discipline, i) => (
                                    <li key={i}>{discipline}</li>
                                ))}
                            </ul>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default Teachers;
